INSERT INTO `manufacturer` (`id`, `title`, `alias`, `imageID`, `body`, `website`, `brandID`, `isPublished`, `meta_title`, `meta_description`, `meta_keywords`) VALUES
	(1, 'Agoprofil', 'Agoprofil', 5620, '<h1 style="text-align: justify;">Традиции и инновации</h1>\r\n<div style="text-align: justify;">Популярная мебельная фабрика AGOPROFIL ведет коммерческую деятельность с далекого 1972 года. Из них на российском рынке марка присутствует 10 лет, и за этот срок она успела полюбиться множеству покупателей. Свою деятельность AGOPROFIL начинала с изготовления классических итальянских дверей из дерева. Со временем старые ремесленные традиции были не просто сохранены, но скомбинированы с различными современными способами производства и дизайна. Сегодня фабрика специализируется на межкомнатных дверях.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h3 style="text-align: justify;">Какие преимущества таят в себе двери AGOPROFIL?</h3>\r\n<ul>\r\n    <li style="text-align: justify;">&nbsp;Классический стиль, сочетающий в себе прошлое, настоящее и будущее;</li>\r\n    <li style="text-align: justify;">&nbsp;Инновационный подход, гарантирующие оптимальные технические характеристики и максимальное удобство монтажа;</li>\r\n    <li style="text-align: justify;">&nbsp;Разнообразие моделей, подходящих как для жилых, так и для офисных помещений;</li>\r\n    <li style="text-align: justify;">&nbsp;Узнаваемый дизайн, нарочитая простота форм и удивительно долгий срок службы.</li>\r\n</ul>\r\n<div style="text-align: justify;">Помимо этого, сегодня AGOPROFIL имеет собственное проектное бюро, где очень &nbsp;чутко реагируют на желания потребителей.</div>\r\n<div style="text-align: justify;">Компания имеет особый сертификат системы качества UNI EN ISO 9001. Это не просто признак того, что предприятию можно доверять, но еще и доказательство способности фабрики гибко реагировать на изменения потребностей рынка. Сертификат свидетельствует о грамотном проектировании и разработке индивидуальных архитектурных решений.</div>\r\n<div style="text-align: justify;">В любой серии дверей, выпускаемых фабрикой, есть модели, сделанные из шпона, из массива и с сотовым наполнением. AGOPROFIL изготавливает и все виды дверных аксессуаров. Сами двери изготавливают в нескольких основных вариантах: распашные, раздвижные двери, и &laquo;книжки&raquo;.</div>\r\n<div style="text-align: justify;">Оформление двери может быть практически любым: от строгой классики до дверей с позолотой, ручной росписью и прочими атрибутами премиум-класса.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h3 style="text-align: justify;">Чтобы было проще найти нужное вам среди всего изобилия моделей, кратко расскажем о каждой серии дверей от AGOPROFIL:</h3>\r\n<ul>\r\n    <li style="text-align: justify;">Серия Class характеризуется строгим классическим дизайном. Двери изготавливаются из древесины.</li>\r\n    <li style="text-align: justify;">Crystal можно расшифровать как кристальную чистоту в оформлении. Количество украшений на деревянных дверях этой серии минимально.</li>\r\n    <li style="text-align: justify;">Diamond изготавливается из шпона. Двери этой серии отличаются наличием матовых стекол.</li>\r\n    <li style="text-align: justify;">Double round похож на серию Diamond, только стеклянные вставки здесь более широкие и напоминают небольшие окна.</li>\r\n    <li style="text-align: justify;">Elegance характеризуется массивными косяками. В дизайне присутствуют овальные вставки из матового стекла.</li>\r\n    <li style="text-align: justify;">Fun отличается яркой расцветкой дверей и создана специально для тех, кто хочет бросить вызов скучной повседневности.</li>\r\n</ul>\r\n<div style="text-align: justify;">Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей AGOPROFIL.</div>', 'http://www.agoprofil.com/ru/', 5, 1, NULL, NULL, NULL),
	(2, 'Astor Mobili', 'Astor-Mobili', 5613, '<p style="text-align: justify;">Основанная в 1961 году в Италии фабрика Astor Mobili за более чем 50-летнюю историю всегда оказывалась одной из первых, кто развивал новые технологии и не боялся отказываться от пережившего свое время дизайна. Именно поэтому продукция фабрики Astor Mobili пользуется популярностью у ценителей современных интерьеров. В дизайне дверей этого производителя нет ничего лишнего, но, в то же время, каждая из них имеет собственный неповторимый стиль. Строгость металла, легкость стекла и благородство дерева воплощаются в фантазиях дизайнера в лаконичные и изящные коллекции. Это сочетается с высоким качеством всех материалов и фурнитуры.</p>\r\n<div style="text-align: justify;">Astor Mobili предлагает серии распашных, складных и раздвижных дверей с коробкой и каркасом из алюминия и дерева, решения для высоких помещений, перегородки, а также особый тип дверей &ndash; открывающиеся стены.</div>\r\n<h4><br />\r\nАлюминий</h4>\r\n<div style="text-align: justify;">Четыре серии, четыре неповторимых коллекции, притягивающих взгляды своей лаконичностью и ультрасовременным дизайном. Коробка и каркас двери выполнены из высокопрочного алюминия серебристого или пепельного цвета. Прозрачное, закаленное или травленое стекло может быть украшено декоративными элементами: легкими штрихами, ритмичными полосками, рассыпными горошинами или утонченной каллиграфией.</div>\r\n<div style="text-align: justify;">Для придания ощущения тепла и домашнего уюта используются вставки и панели из цельной древесины или шпона. Богатство расцветок достигается широким выбором деревянных панелей, а также лака, которым может быть покрыто дерево или стекло. Серии Atlantic и Next отличаются особой утонченностью и легкостью, Xila &ndash; домашним уютом, а Gemini &ndash; деловой солидностью.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Древесина</h4>\r\n<div style="text-align: justify;">При производстве дверей 12 серий, объединенных производителем в общую группу &laquo;древесина&raquo;, используется не только дерево. В отдельных сериях каркас и коробка выполнены из алюминия, скрытого деревянными панелями. Разумное сочетание надежности, легкости и прочности конструкции с благородным внешним видом позволило компании Astor Mobili завоевать любовь дизайнеров всего мира.</div>\r\n<div style="text-align: justify;">Створки дверей серий Сalypso, Duel, Flap, Line и Piana цельные. Что, впрочем, не помешало производителю изящно украсить серию Calipso вставками из плексигласа, а серию Line &ndash; ритмичным рисунком из алюминиевых вставок по всей ширине полотна.</div>\r\n<div style="text-align: justify;">Стекло и древесина гармонично сочетаются в сериях Clever, Firma и Tekno. В отделке моделей серии Clever этот союз дополняется широкими кожаными полотнами.</div>\r\n<div style="text-align: justify;">На передний план стекло выходит в сериях Maja, Opera, Plaza и Twin. Решетчатые двери серии Maja подчеркнуто легкомысленны. В сериях Opera и Plaza стеклянные вставки выполнены более строгими прямоугольниками. Серия Twin &ndash; цельное стеклянное полотно, окаймленное профилированной панелью, скрытой под шпоном.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Открывающиеся стены</h4>\r\n<div style="text-align: justify;">Уникальная конструкция раздвижных и распашных дверей &ndash; собственная запатентованная разработка фабрики Astor Mobili. Идеальное решение для зонирования и реорганизации пространства жилого помещения или офиса. Открывающиеся стены позволяют в одно мгновение объединить две комнаты в единую залу или наоборот отделить зону отдыха, гостиную, пространство для ведения переговоров.</div>\r\n<div style="text-align: justify;">Двери серии Bridge отличаются раздвижной конструкцией, а Meeting &ndash; особым решением, когда одна створка играет роль &laquo;обычной&raquo; двери, а вторая &ndash; распашной стены.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Решения для высоких помещений</h4>\r\n<div style="text-align: justify;">Модели серии Wing &ndash; это интересное развитие концепции открывающихся стен. Высота таких дверей равна высоте потолка, но их ширина, а значит и требование к свободному для открывания пространству, &ndash; как у обычной межкомнатной двери.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Перегородки и панели</h4>\r\n<div style="text-align: justify;">Если вам близка по духу идея оформления интерьера ширмами из цельного листа стекла, строго обрамленного металлическим профилем или деревянной панелью, то серия перегородок Screen позволит вам воплотить самые смелые фантазии. Надежная конструкция проста в установке и универсальна.</div>\r\n<div style="text-align: justify;">А для оформления отдельных зон обратите внимание на серии стеновых панелей Area 48, Delta, Sticker и Matrix. Их главная особенность &ndash; функциональные элементы, полки, вешалки, зеркала, которые оставляют широкий простор как с точки зрения удобства использования, так и с точки зрения дизайна интерьера.</div>\r\n<div style="text-align: justify;">Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей Astor Mobili.</div>', 'http://www.astor.it/', 4, 1, NULL, NULL, NULL),
	(3, 'Bosca', 'Bosca', 5641, '<p>Основанная в 1968 году в Италии семейная столярная мастерская братьев Скапин превратилась в завод Bosсa Arredi, занимающий площадь в 5 тысяч квадратных метров. На фабрике трудятся три десятка человек, включая учредителей, лично следящих за производственным процессом. И если когда-то Bosсa выполняла нехитрые заказы жителей ближайших домов, то сейчас три четверти продукции завода отправляются на экспорт в западную Европу, США и Россию.</p>\r\n<div>Продукция Bosсa ценится дизайнерскими и архитектурными студиями, строительными организациями и дверными салонами. На базе завода работает собственное проектное бюро. Создавая уникальный дизайн и расширяя гамму цветовых решений, Bosсa не забывает и про совершенствование технологии. Компания стремится к балансу между разнообразием модельного ряда, качеством производства, вниманием к деталям и простотой монтажа. Именно в поиске этого идеального сочетания фабрика видит свою миссию.</div>\r\n<div>Продукция завода представлена тремя коллекциями: Exit, Entry и Light, каждая из которой насчитывает не менее девяти моделей, не считая разнообразия цветовых решений и декоративного оформления. Помимо дверей, Bosсa предлагает систему хранения Flexis.</div>\r\n<div>Материалы, которые использует Bosсa, традиционны &ndash; алюминий, дерево, шпон и 4-6-миллиметровое стекло. Невооруженным взглядом заметна любовь дизайнеров компании к металлу, как к легкой, надежной и универсальной основе для создания своих шедевров. Для отделки дверей всех серий используется шпон таких пород, как клен, бамбук, вишня, орех, палисандр, дуб, венге. А стекло может быть прозрачным, молочно-белым, бронзовым, дымчатым или цветным.</div>\r\n<div>&nbsp;</div>\r\n<h4>Exit</h4>\r\n<div>Коллекция из девяти моделей разработана дизайнером Stipiti Laterali. Хотя каждая дверь коллекции по-своему уникальна, все они объединены идеей ритмичного горизонтального или вертикального рисунка. Игра с чередованием стекла и деревянных панелей создает ощущение легкости и непринужденности.</div>\r\n<div>&nbsp;</div>\r\n<h4>Entry</h4>\r\n<div>Модели этой коллекции идеологически повторяют серию Exit, но отличаются большей сдержанностью и строгостью. Если двери Exit создают домашний уют, то Entry скорее настраивают на деловой лад. Функциональность и качество выступают на первый план, оставляя этим дверям роль последних штрихов, но не доминант интерьера.</div>\r\n<div>&nbsp;</div>\r\n<h4>Light</h4>\r\n<div>Серия Light стала &laquo;визитной карточкой&raquo; фабрики Bosсa. Это воплощение минимализма и совершенства. Название серии как нельзя лучше подчеркивает эту идею. Абсолютизм достигнут в моделях Light Plus, Light Universal и Light Minimal. Они справедливо заслужили собственное имя, а не порядковый номер в каталоге. Цельная стеклянная панель и ничего лишнего. Казалось бы, предельно просто, но на самом деле, это весьма смелый дизайнерский шаг.</div>\r\n<div>Двери серии Light пользуются глубокой симпатией не только у тех, кто ценит функциональность, облаченную в простые формы. Богатство расцветок, стекла и декоративных элементов оставляют дизайнерам широких простор для фантазии, по сути, предлагая создать собственное решение с чистого листа на базе высококачественных и зарекомендовавших себя с лучшей стороны составных частей.</div>\r\n<div>&nbsp;</div>\r\n<h4>Flexis</h4>\r\n<div>Сначала кажется несколько странным, что компания, чье имя во всем мире ассоциируется именно с дверьми, решилась на создание собственной системы хранения. Но в этом есть глубокий смысл. Серия Flexis &ndash; это не еще одно направление производства, а тонкий имиджевый ход. Фабрика Bosсa изящно демонстрирует, что она способна на большее, чем производство дверей, но выбирает это направление осознанно, так как видит в нем свое предназначение.</div>\r\n<div>Что касается самой системы хранения, она выполнена в лучших традициях фабрики и идеально сочетается с раздвижными дверями Bosko, позволяя вписать в интерьер вместительный шкаф или отделить просторную гардеробную.</div>\r\n<div>Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей Bosca.</div>', 'http://www.boscaarredi.it/', 1, 1, NULL, NULL, NULL),
	(4, 'Casali', 'Casali', 5639, '<p style="text-align: justify;">Дизайнеры итальянской фабрики Casali превращают обычное стекло в нечто новое. Они смело пресекают границы традиционного представления об обработке материала, к которому с трепетом относились во все времена. Создание произведений мастерами Casali сродни живописи, только вместо холста используется стеклянное полотно. Тот же неограниченный простор для фантазии, тот же поиск вдохновения и та же непредсказуемость результата. Именно так художники по стеклу создают шедевры Casali, поражающие ценителей изысканных интерьеров.</p>\r\n<div style="text-align: justify;">Сотрудничая с проектировщиками, дизайнерами и архитекторами более тридцати лет, компания дала рождение ряду технологичных решений в области оформления интерьеров стеклянными полотнами. Прозрачность стекла и игра декоративных элементов позволяют разделить помещения, сохранив единство пространства. Двери Casali не стоят на пути света, они пропускают его через фильтр фантазии мастера, создавая неповторимую атмосферу легкой изысканности.</div>\r\n<div style="text-align: justify;">Огромный опыт обработки стекла позволяет Casali сочетать изящность этого материала с функциональностью и надежностью. Едва заметные соединительные элементы из полированной нержавеющей стали и лаконичная фурнитура &ndash; это собственные разработки компании. Двери Casali отвечают нормам безопасности, стандартам надежности и качества. Подчеркивая, что произведения безупречны не только внешне, но и функционально, компания разделят модели не по сериям, а по функциональному назначению.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4 style="text-align: justify;">Plane Solutions</h4>\r\n<div style="text-align: justify;">Под скромным заголовком, который можно перевести как &laquo;решения на плоскости&raquo; Casali скрывает свои львиную долю своего ассортимента. Здесь собраны двери, полотна которых &ndash; это цельный лист стекла. Распашные и раздвижные одно- и двуполотные модели отличаются декоративным оформлением и фурнитурой. В оформлении отдельных дверей, помимо стекла и металла, используется шпон для отделки дверной коробки.</div>\r\n<div style="text-align: justify;">Помимо стандартных решений для сдвижных дверей, когда механизм прячется за верхней кулисой или внутри дверного проема, Casali предлагает смелое решение, получившее называние System. В дверях System механизм не прячется, а наоборот открыто демонстрируется. Металлическая штанга крепится над дверным проемом, а дверь фиксируется на двух роликах. Развитием этой идеи стал механизм System Zero, когда штанга частично скрывается верхним полотном самой двери.</div>\r\n<div style="text-align: justify;">Еще одна находка Casali &ndash; стеклянные раздвижные ширмы. Конструкция состоит из четырех полотен. Два полотна &ndash; непосредственно двери, а еще два &ndash; прозрачные стены. Пожалуй, это лучшее подтверждение того, что мастера фабрики умеют играть со светом, пропуская его через матовые стекла и декор и превращая эту игру в элемент интерьера.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4 style="text-align: justify;">Soluzioni Curve</h4>\r\n<div style="text-align: justify;">Особое решение от фабрики Casali &ndash; двери с изогнутым полотном. В серии доступны распашные и раздвижные модели, включая двери с открытым механизмом System. Эти модели решают проблему организации дверного проема в изогнутых стенах, позволяя архитекторам смело использовать радиальные перегородки для организации пространства.</div>\r\n<div style="text-align: justify;">Colorate и Bi-Color</div>\r\n<div style="text-align: justify;">Отдавая дань минималистичным решениям, Casali создала серии одноцветных и двуцветных дверных полотен. Такие двери ведут двойную игру со светом: светящийся сочным оттенком дверной проем претендует на роль доминанты интерьера, а мягкое пастельное отражение на полу оттеняет яркость цветового пятна.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4 style="text-align: justify;">I Miti</h4>\r\n<div style="text-align: justify;">Четыре черно-белых полотна, четыре гравюры, четыре образа погружают нас в атмосферу пятидесятых. Элвис Пресли, Одри Хепберн, Мэрилин Монро и Джеймс Дин увековечены в серии, название которой переводится как &laquo;Мифы&raquo;.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4 style="text-align: justify;">Strutture</h4>\r\n<div style="text-align: justify;">Огромный опыт работы с цельными стеклянными полотнами позволяет фабрике заниматься не только дверьми. Речь идет о серии сборных стеклянных конструкций, которые могут использоваться для оформления выставочных стендов, торговых площадей, офисных помещений и даже жилого пространства. Прозрачные или цветные стеклянные полотна, в том числе изогнутые, соединяются между собой надежными элементами из нержавеющей стали. Универсальность конструкции оставляет огромный простор для дизайнерской фантазии, позволяя конструировать структуры разных форм и разного назначения.</div>\r\n<div style="text-align: justify;">Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей Casali.</div>', 'http://www.casali.net/', 23, 1, NULL, NULL, NULL),
	(5, 'Comas', 'Comas', 5803, '<p style="text-align: justify;">Основанная в 1976 году итальянская деревообрабатывающая фабрика Comas на протяжении многих лет хранит лучшие традиции работы с массивом дерева, совмещая их с новейшими технологиями в области производства дверей, перегородок, мебели и других элементов интерьера.</p>\r\n<div style="text-align: justify;">Хотя сегодня Comas &ndash; это полноценное мебельное производство, владельцам фабрики удалось сохранить обаяние небольшой столярной мастерской, где могли бы плечо к плечу трудиться отец со своим сыном. Каждое изделие, созданное в стенах этого предприятия, хранит тепло ручной работы и привносит в дом счастливого обладателя гармонию тихого семейного уюта. Дух маленькой мастерской подчеркивается и индивидуальным подходом к каждому заказу. Comas учитывает пожелания частных покупателей, создавая предметы под конкретные проекты. Такая гибкость справедливо заявляется компанией, как основное преимущество.</div>\r\n<div style="text-align: justify;">Немногие заводы такого формата позволяют себе вкладываться в разработки, предпочитая работать по чужим технологиям или использовать проверенные десятилетиями конструкции. Но Comas не пытается сэкономить на развитии, перенимая лучший мировой опыт и используя собственные решения в области производства дверей и мебели. Профессионализм работников фабрики обеспечивает стабильно высокое качество. Именно поэтому с Comas сотрудничают магазины, бары, рестораны, банки и даже государственные учреждения Италии, а продукция завода популярна далеко за пределами страны.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Межкомнатные раздвижные двери</h4>\r\n<div style="text-align: justify;">Одно из основных направлений фабрики &ndash; межкомнатные раздвижные двери и перегородки из массива дуба, сосны, вишни, ясеня, груши и ореха. Ценные породы дерева сочетаются со стеклом, рисовой бумагой, японской тканью из конопляного волокна и другими натуральными материалами. Хотя Италию и страны дальнего востока отделяют тысячи километров, японские мотивы особенно проявляются в лаконичных решетчатых формах дверей.</div>\r\n<div style="text-align: justify;">Модели раздвижных дверей отличаются сортами дерева и дополнительными материалами. Темная порода в гармонии с матовым стеклом несет идею монументальности. Такие двери хорошо подчеркивают строгие интерьерные решения. Древесина светлых оттенков, дополненная неокрашенной тканью, лучше подходит для создания ощущения легкости и беззаботности. Зеркальные вставки увеличивают пространство, а прозрачное стекло предельно деликатно разделяет комнаты, сохраняя единство помещения.</div>\r\n<div style="text-align: justify;">Для ценителей нестандартных решений все многообразие сочетаний материалов и форм доступно в серии радиусных раздвижных дверей. Тоже натуральное дерево, стекло или ткань, но особая изогнутая форма и конструкция, позволяющая двери плавно и мягко скользить по стене или убираться в нее.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Решетчатые панели и другая продукция</h4>\r\n<div style="text-align: justify;">Универсальный материал для оформления пространства Comas скромно называет &nbsp;&laquo;деревянными решетками&raquo;. На практике эти панели находят самое широкое применение, начиная от декоративных ширм, заканчивая отделкой потолка или составным элементом легкой стены. Здесь нельзя однозначно говорить о преобладании восточных мотивов. Решетчатые панели уже претендуют на звание итальянской классики.</div>\r\n<div style="text-align: justify;">Среди другой продукции Comas &ndash; ширмы для радиаторов, столы, библиотеки и даже лестничные перила. Кажется, что мастера Comas настолько влюблены в свое дело, что просто не могут выбрать одно направление. Любая работа с деревом доставляет им истинное удовольствие и позволяет создавать с одной стороны простые, а с другой &ndash; необычайно притягательные предметы интерьера.</div>\r\n<div style="text-align: justify;">Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей Comas.</div>', 'http://www.comasitaly.com/', 38, 1, NULL, NULL, NULL),
	(6, 'Colombo', 'Colombo', 5643, '', 'http://www.colombodesign.com/', 24, 1, NULL, NULL, NULL),
	(7, 'Cocif', 'Cocif', 5634, '<p>Компания Cocif со всей уверенностью заявляет о себе, как о лидере на рынке деревянных дверей. Чтобы выделиться на столь насыщенном рынке, мало просто производить двери &mdash; необходимо суметь доказать свою исключительность. И Cocif удалось это сделать!</p>\r\n<div>Небольшая столярная мастерская, открытая в послевоенном 1945 году, стала сегодня крупнейшим предприятием с широкой дилерской сетью по всему миру. Ради этого Cocif не жалели ни сил, ни ресурсов. Вкладывая немалые средства в развитие технологий, компания сумела добиться признания покупателей и уважения коллег. Инновации, высокое качество и стиль &mdash; на этих трёх китах и основан успех предприятия.</div>\r\n<div>Основу каталога Cocif составляют межкомнатные двери, двери для гостиниц и медицинских учреждений. Компания привлекает к сотрудничеству ведущих дизайнеров, а возможности ультрасовременных производственных мощностей Cocif позволяют воплотить любые их идеи. Соединение классической изысканности с современными видами отделки, смелые решения и не менее смелые способы их воплощения в исполнении Cocif никак не противоречат с функциональностью дверей, простотой их монтажа и удобством эксплуатации. Лишь несомненный лидер способен производить двери, столь же красивые, сколь и практичные!</div>\r\n<div>Штаб-квартира Cocif находится в небольшом итальянском городке Лонджано, а её продукция украшает крупнейшие отельные комплексы и жилые дома по всему миру. Cocif находится в постоянном поиске новых возможностей, новых стилей, новых технологий. А это значит, что новые коллекции будут восхищать и радовать покупателей, новые модели дверей будут надёжно служить и украшать наши дома!</div>\r\n<div>&nbsp;</div>\r\n<h4>GAE AULENTI</h4>\r\n<div>Сотрудничество со знаменитыми дизайнерами и архитекторами позволяет Cocif предлагать своим поклонникам поистине удивительные коллекции. Как, например, эта, в разработке которой принимал участие Gae Aulenti. Гармония пропорций и простых геометрических линий, скрупулёзность в выборе цвета и внимание к мельчайшим деталям характеризуют модели межкомнатных дверей этой коллекции. 6 моделей &mdash; 6 произведений искусства!</div>\r\n<div>&nbsp;</div>\r\n<h4>MITI</h4>\r\n<div>Miti &mdash; это двери для классических интерьеров! Многослойный массив деревянных дверных рам окрашен или покрыт шпоном благородных пород. Полнотелое или ячеистое дверное полотно, украшенное рельефными панелями. Большой выбор вариантов дверей с различными видами остекления. Выбирая двери их коллекции Miti, покупатели с замиранием сердца представляют, каким же станет скоро их дом!</div>\r\n<div>&nbsp;</div>\r\n<h4>BASIC</h4>\r\n<div>Самая демократичная, и, пожалуй, одна из наиболее популярных коллекций от Cocif! Межкомнатные двери, покрытые шпоном драгоценных пород самого высокого качества, полностью передают ощущение живого дерева. Двери, способные удовлетворить любые требования потребителя, воплотили в себе престижность бренда и неизменно высокое качество продукции.</div>\r\n<div>&nbsp;</div>\r\n<h4>CONTRACT</h4>\r\n<div>Коллекция дверей для отелей, с повышенной звуконепроницаемостью. Для удобства отельного обслуживания установленные в дверях замки позволяют использовать общий ключ. Двери имеют международные сертификаты соответствия правилам пожарной безопасности REI30 и REI60.</div>\r\n<div>Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей Cocif.</div>', 'http://www.cocif.com/', 39, 1, NULL, NULL, NULL),
	(8, 'Dierre', 'Dierre', 5610, '<p>Продукция компании &mdash; межкомнатные, входные, бронированные и противопожарные двери, гаражные ворота &mdash; известна во всём мире. Широко известны и замки для входных и межкомнатных дверей, выпускаемые под этим брендом. В слогане Dierre &laquo;Твой дом, твоя жизнь&raquo; ясно слышны отголоски поговорки &laquo;Мой дом &mdash; моя крепость&raquo;: стремление сделать жизнь людей безопасной вполне можно назвать миссией компании.</p>\r\n<div>Первая бронированная дверь Dierre была выпущена в 1978 году. С тех пор компания значительно расширила производство, ассортимент Dierre пополнился защитными и противопожарными дверьми, сейфами и гаражными воротами, межкомнатными дверьми. Компания всегда много инвестировала в развитие технологий и производства, что обусловило и широту каталога Dierre, и высокое качество всей продукции фирмы.</div>\r\n<div>Фирме принадлежит сеть розничных магазинов Dierre Partner, где качеству обслуживания и профессионализму продавцов уделяется такое же внимание, как и качество разработок и производства. Успешно функционирует также и сеть Dierre Key Point, распространяющая профессиональные скобяные товары и метизы, а всю необходимую помощь и консультации можно получить в службе технической поддержки Dierre Technical Service.</div>\r\n<div>Ассортимент межкомнатных дверей Dierre невероятно широк, даже небольшое описание каждой модели превратит статью в обширный трактат о дверях. Рассмотрим кратко продукцию фирмы, придерживаясь предложенной на сайте компании классификации по материалу изготовления дверей.</div>\r\n<div>&nbsp;</div>\r\n<h4>Mood Wood Basic</h4>\r\n<div>Это универсальный ряд моделей межкомнатных дверей, которые подойдут и для офисных, и для жилых помещений. Basic представляет собой гармоничное сочетание самых современных технологий и строгого минимализма в дизайне. Коллекцию составляют 7 моделей межкомнатных дверей, каждая из которых, в свою очередь, предлагается в различных вариантах отделки и конструкции: одно-, двухстворчатая и раздвижная.</div>\r\n<div>&nbsp;</div>\r\n<h4>Mood Wood &mdash; двери из цельного дерева</h4>\r\n<div>Что может быть естественнее изделий из цельного натурального дерева! Эти межкомнатные двери солидны и эстетичны, одним своим видом они говорят о спокойной уверенности в себе. Чтобы выделиться из толпы и приобрести индивидуальность, вовсе не обязательно гнаться за модой. Вернее будет остановиться и обернуться к классике.</div>\r\n<div>Mood Wood из цельного дерева &mdash; это десять моделей с разнообразными видами отделки, каждая из которых индивидуальна.</div>\r\n<div>&nbsp;</div>\r\n<h4>Mood Wood &mdash; лакированные двери</h4>\r\n<div>Эта коллекция призвана отразить самые новые тенденции в дизайне интерьера. Составляющие её 7 моделей вобрали в себя всё лучшее, что есть в современном интерьерном дизайне, умноженное на креативность и технологичность Dierre. Поиск интересных форм и интерес к использованию новых материалов отразил давнее кредо компании, заботу о безопасности потребителей. В оформлении дверей использовались исключительно безвредные и экологичные краски и лаки.</div>\r\n<div>&nbsp;</div>\r\n<h4>Mood Wood &mdash; двери с алюминиевой рамкой</h4>\r\n<div>Живое дерево и современные материалы, сочетание &laquo;холодного&raquo; алюминия с тёплым рисунком деревянной текстуры, эклектика, которая не выглядит противоречием, а дышит гармонией. Как и во всём, что делает Dierre, в этой коллекции классика дружит с трендами, даря покупателям радость обновления интерьера!</div>\r\n<div>Рассказ о Dierre был бы неполным без упоминания ещё одного практического воплощения неустанной заботы компании о безопасности. Безопасность для Dierre &mdash; понятие широкое, включающее в себя и заботу о сохранении окружающей среды. В 2009 году Dierre стала партнёром агентства CasaClima, которое занимается энергетической и экологической паспортизацией. Целью этого партнёрства Dierre определяет &laquo;развитие экологического сознания в обществе&raquo;.</div>\r\n<div>Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей &nbsp;Dierre.</div>', 'http://www.dierre.it/', 21, 1, NULL, NULL, NULL),
	(9, 'Ghizzi&Benatti', 'Ghizzi-Benatti', 5636, '<p style="text-align: justify;">Со дня своего основания в 1987 году фабрика Ghizzi&amp;Benatti производит межкомнатные двери. Кто-то скажет: &laquo;Ещё одна итальянская дверная фирма!&raquo;, и будет не прав. Среди действительно немалого числа производителей дверей в Италии не найти двух одинаковых, каждая компания имеет своё лицо и свой стиль. И в особой мере это относится к Ghizzi&amp;Benatti!</p>\r\n<div style="text-align: justify;">Особое внимание дизайнеры уделяют деталям, которые, как известно, и создают стиль. Каждая модель межкомнатных дверей эксклюзивна и индивидуальна. Эти двери имеют своё настроение и свой характер, они не просто вписываются в интерьер, а создают его.</div>\r\n<div style="text-align: justify;">Базовыми понятиями дизайна Ghizzi&amp;Benatti называют творчество и культуру. В самом начале разработки новой идеи её основной целью определяют выражение культуры современности посредством дизайнерских решений. Бренд быстро стал означать в сознании потребителей современный эксклюзивный дизайн и высокое качество. Компания производит действительно эксклюзивные двери: отделанные натуральным шпоном, с любовно закруглёнными твёрдыми гранями и лакировкой, которая выглядит, как атлас, талантливо придуманные и безупречно изготовленные.</div>\r\n<div style="text-align: justify;">Продукцию фабрики модно увидеть на известных отраслевых выставках: MadeExpo Milano, Macef Milano, Cosmoprof Bologna и других. Посетители этих форумов производителей имеют возможность насладиться коллекциями межкомнатных дверей Ghizzi&amp;Benatti, выбрать и заказать понравившиеся модели. Предоставим такую возможность и вам:</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4 style="text-align: justify;">REFLEX</h4>\r\n<div style="text-align: justify;">Межкомнатные двери из глянцевого стекла, одного из самых модных сегодня материалов. Дверная рама изготовлена из массива дерева, особая конструкция позволяет установить ручку любого типа. Модель может быть изготовлена в виде распашной либо раздвижной конструкции, в одном из 14 стандартных размеров, или под заказ &mdash; высотой до 2700 мм.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4 style="text-align: justify;">COLORE</h4>\r\n<div style="text-align: justify;">Обширная коллекция дверей самого разнообразного дизайна и цвета. Белый ясень и красное дерево, вишня и дуб венге, итальянский орех и отбеленный дуб, &mdash; вряд ли найдётся вариант цветовой отделки, не вошедший в Colore!</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4 style="text-align: justify;">STREAM</h4>\r\n<div style="text-align: justify;">Эта коллекция &mdash; настоящий Stream, поток дизайнерских находок в стиле утончённого минимализма. Серия предлагает 9 различных комбинаций видов отделки и вставок, плюс огромное количество конструктивных вариантов. Коллекция включает в себя распашные, раздвижные и уходящие в стену двери.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4 style="text-align: justify;">STONE</h4>\r\n<div style="text-align: justify;">В этой коллекции основное внимание уделено дизайну: утончённые линии, особое внимание к деталям отделки. И, конечно, только натуральное дерево!</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4 style="text-align: justify;">ENERGY</h4>\r\n<div style="text-align: justify;">Великолепная коллекция дверей, отделанных шпоном оливкового дерева, с диапазоном цветов от натуральной оливы до графита. Некоторые модели содержат декоративные вставки матового стекла в зеркальной рамке.</div>', 'http://www.ghizziebenatti.it/', 20, 1, NULL, NULL, NULL),
	(10, 'FOA', 'FOA', 5614, '<p style="text-align: justify;">1974 год так и остался бы ничем не примечательной датой в истории дизайна и производства межкомнатных дверей, не будь в этом году основана компания FOA porte на базе завода художественной игрушки, и давшему новой фирме свою аббревиатуру (Fabbrica Oggetti Artistici) в качестве имени.</p>\r\n<div style="text-align: justify;">Слоган компании &mdash; &laquo;Двери для жизни&raquo; &mdash; как нельзя лучше отражает подход FOA к разработке и производству своей продукции, пользующейся спросом далеко за пределами Италии. Этот короткий девиз выражает и концептуальную философию FOA, и её прикладное применение в деятельности. Эти двери действительно привносят в дом частичку радости жизни!</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h3>Стекло, алюминий и дерево</h3>\r\n<div style="text-align: justify;">Стекольный цех в FOA считают сердцем компании. Здесь умелые руки мастеров воплощают в жизнь оригинальные идеи дизайнеров, превращая стекло в волшебные витражи и отделку. Не менее серьёзно в компании относятся и к дереву, ведь от качества сырья и точности его обработки зависит качество конечного продукта. Тщательно выбирая дерево лучших сортов, краснодеревщики компании создают настоящие шедевры дверного искусства! Широко используются и алюминиевые конструкции. Дизайнеры FOA porte любят этот лёгкий и прочный материал!</div>\r\n<div style="text-align: justify;">Россияне получили отличную возможность познакомиться с продукцией FOA весной 2009 года, когда компания представила свою экспозицию на московской выставке &laquo;MosBuild Doors&amp;Locks 2009&raquo;. Естественно, появление производителя такого масштаба не могло остаться незамеченным для российских бизнесменов, в результате чего продукция компании стала доступной и в России.</div>\r\n<div style="text-align: justify;">FOA porte предлагает несколько коллекций межкомнатных дверей, каждая из которых вызывает восхищение и уважение к кропотливой работе дизайнеров, проектировщиков и мастеров компании.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>TEKNO</h4>\r\n<div style="text-align: justify;">Сочетание стали и стекла вдохновило дизайнеров компании на создание этой коллекции. Одно- и двух панельные раздвижные двери, представленные в каталоге Tekno, отличаются минимализмом, чёткостью линий и высокой точностью исполнения. Уникальная техника декорирования &quot;Vetro Liquido&quot; позволила создать ультрасовременные межкомнатные двери с яркой отделкой.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>ELEGANCE</h4>\r\n<div style="text-align: justify;">В эту коллекцию вошли 73 модели дверей, отделанных 244 видами стекла. Среди практически бесконечного выбора всевозможных комбинаций каждый найдёт именно те двери, которые ему хотелось бы видеть у себя дома! Элегантная классика тесно переплетается с современными дизайнерскими находками, придавая индивидуальность каждой из моделей. В коллекции представлены различные конструкции межкомнатных дверей: раздвижные и уходящие в стену, складные двери-концертино, распашные двери с одной и двумя створками.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>SLIM</h4>\r\n<div style="text-align: justify;">Двери выполнены из разных пород дерева или же из алюминия, однако главный герой этой коллекции &mdash; стекло. Строгие линии дверных рам, внутри которых разыгрывается неудержимая</div>\r\n<div style="text-align: justify;">игра света. Минимализм исполнения &mdash; максимум вдохновения!</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>SINTHESY</h4>\r\n<div style="text-align: justify;">Созданию этой коллекции предшествовали глубокий анализ актуальных трендов и основательное изучение современных стилей дизайна. Алюминий, многослойное стекло, геометрические аппликации придают этим дверям фантастический вид! Представленные в коллекции модели Quadra, Sliver, Stylo и Light очаруют поклонников модных течений в дизайне интерьера.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>FLAT</h4>\r\n<div style="text-align: justify;">Раздвижные перегородки и распашные межкомнатные двери этой коллекции выполнены из тонкого профиля с квадратным сечением. Они функциональны и красивы, отделка стеклянных поверхностей идеальна, а узоры &mdash; завораживают. Flat можно было бы назвать лучшими межкомнатными дверями, не существуй у FOA других коллекций!</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Каталог FOA porte наводит на мысль, что не существует пределов в нахождении всё новых и новых способов обработки стекла, составления узоров на стеклянных поверхностях, мозаик и витражей. Каждая коллекция компании раскрывает новые направления дизайна интерьера, вдохновляя и радуя. FOA porte &mdash; настоящие &laquo;двери для жизни&raquo;!</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей FOA.</div>', 'http://www.foaporte.it/', 6, 1, NULL, NULL, NULL),
	(11, 'Flex', 'Flex', 5633, '', 'http://www.flexporte.it/', 14, 1, NULL, NULL, NULL),
	(12, 'Henry Glass', 'Henry-Glass', 5632, '<p style="text-align: justify;">Фабрика Henry Glass основана в 1988 году, однако мировую популярность работы итальянских мастеров получили после 2005, когда предприятие было полностью переоборудовано. Сейчас завод занимает 20000 квадратных метров и использует передовые технологии в области резки и колеровки стекла, обработке кромки и декоративном оформлении.</p>\r\n<div style="text-align: justify;">Несмотря на активное применение современных технологий, в производстве широко используется ручной труд декораторов, работающих с венецианским (муранским) стеклом. Это позволяет Henry Glass относить себя не просто к производителю дверей, а к законодателям интерьерного дизайна.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">В производстве используются прозрачные, цветные и покрыты лаком стеклянные пластины более чем двух десятков расцветок. Но цвет самого полотна &ndash; не единственное, что позволяет художникам Henry Glass создавать уникальные по технике и орнаменту стеклянные двери. Вставки из венецианского стекла придают полотну живость, наделяют его характером и привносят легкость. Спокойные абстрактные узоры, позволяющие сохранить строгость и элегантность, создаются методом пескоструйной шлифовки. Зеркальный лак создает эффект глубины, расширяя пространство игрой отражения и света.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Традиционно для производителей дверей, Henry Glass предлагает несколько типов открывания полотна. Запатентованный механизм распашных дверей позволяет распахивать их на 180 градусов. Сдвигающиеся в стену отличаются простотой установки конструкции. Сдвижные внешние двери представлены как просто сдвижным полотном на открытой конструкции, так и в составе стеклянной стены, направляющие которой могут крепиться в проеме или прямо к пололку. Наконец, фабрика предлагает двери, распахивающие в обе стороны. Механизм крепежной конструкции практически незаметен, поэтому со стороны создается ощущение, что дверное полотно удерживают невидимые силы.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h3>Коллекции</h3>\r\n<div style="text-align: justify;">Хотя все многообразие вариантов цветовой гаммы, ручной работы и технологичных решений, не терпит строгого деления по коллекциям, Henry Glass выделяет свои шедевры в четыре серии.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Vitra</h4>\r\n<div style="text-align: justify;">Коллекция дверей Vitra возвышает чистоту стекла полным отсутствием какого бы то ни было обрамления самого полотна и идеальной полировкой края по периметру. Здесь нет лишних элементов: только стекло, практически незаметная фурнитура и лаконичная металлическая рама.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Sinea</h4>\r\n<div style="text-align: justify;">Легкость ровного стеклянного полотна изящно оттеняется тонкими полосками алюминия. &nbsp;Контраст между стеклом и металлом создает двойной эффект цвета и текстуры, сочетая воздушность с прочностью, а доступность с надежностю.</div>\r\n<div style="text-align: justify;">Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей Henry Glass.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Tekna</h4>\r\n<div style="text-align: justify;">Эта коллекция отдает дань минималистичному направлению дизайна интерьеров. Ничего лишнего, ничего слишком привлекающего внимания. Эргономичные ручки, тонкие профили в различной отделке и простое листовое стекло &ndash; вот секрет изящества дверей серии Tekna.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Domea</h4>\r\n<div style="text-align: justify;">В этой серии дизайнеры Henry Glass позволили металлу и дереву стать полноправными участниками живописного полотна, а не оттеняющим дополнением, как в других коллекциях. Широкие линии металла придают монументальности, а отделка шпоном создает ощущение уюта и привносит нотку классики в оформление пространства.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h3>Художники фабрики</h3>\r\n<div style="text-align: justify;">Для фабрики Henry Glass настоящие произведения искусства воплощают в стекле семь выдающихся художников Италии. Работы Ugo Nespolo несут идею оживления изначально строго функционального и безликого дизайна. Alessandro Mendini виртуозно расписывает двери линиями, идущими строго параллельно и изгибающимися только под прямыми углами. Riccardo Dalisi, Afra e Tobia Scarpa и Emilio Tadini используют дверное полотно, как идеальный фон для своих витражных картин. Renata Bonfanti работает со всем полотном, покрывая его причудливым текстурным орнаментом. Bruno Munari точно чувствует грань между лаконичным дизайном и изящным искусством.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">В этом главный секрет Henry Glass &ndash; объединить индивидуальность авторов с передовыми технологиями и непревзойденным качеством конструкций и фурнитуры.</div>', 'http://www.henryglass.it/', 7, 1, NULL, NULL, NULL),
	(13, 'Impronta', 'Impronta', 5635, '<p style="text-align: justify;">Итальянская фабрика Impronta, основанная в итальянском городе Тревизо в результате слияния нескольких малых производств, специализируется на создании входных и межкомнатных дверей, окон и ставень, решений для гостиниц и ресторанов. Само предприятие появилась сравнительно недавно &ndash; около 20 лет назад, однако компании, объединившиеся под именем Impronta, могут похвастаться полувековой историей.</p>\r\n<div style="text-align: justify;">За годы существования фабрики ее продукция неоднократно совершенствовалась и улучшалась. Речь идет не столько о развитии технологий, сколько о внешнем исполнении. Произведения Impronta соответствуют духу времени и отвечают актуальным стилистическим требованиям. Впрочем, дизайнеры фабрики не забывают и о традициях, но это заслуживает отдельного разговора.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Чтобы оставаться законодателями современной интерьерной моды, на базе Impronta было создано проектное бюро. Весь цикл производства, начиная с эскизов и подборки материалов, заканчивая тестированием и поступлением готовых изделий в продажу, осуществляется силами фабрики. Автоматизация всех этапов позволяет добиться высочайшего качества при интенсивной разработке новых решений. Каждая модель каждой серии &ndash; плод совместного труда дизайнеров, технологов, инженеров и других специалистов Impronta. Осуществляя полный цикл производства, фабрика Impronta подчеркивает свою индивидуальность и самодостаточность.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h3><span style="text-align: start;">Межкомнатные двери</span></h3>\r\n<div style="text-align: justify;">Межкомнатные двери представлены четырьмя коллекциями. Основной ассортимент распределен по коллекциям Modern и Design, а небольшие серии Classic и NextDoor емко отражают два абсолютно разных направления дизайна. Которые, однако, успешно сосуществуют в рамках ассортимента продукции Impronta.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Modern</h4>\r\n<div style="text-align: justify;">Современные межкомнатные двери, какими мы привыкли их видеть. Гармоничное сочетание дерева и стекла, реже &ndash; цельные полотна с рельефной отделкой. Лаконичные, стильные, подчеркнуто деловые. Строгие прямые линии и спокойное сочетание цветов позволяет этим дверям претендовать на звание классики 21 века. Модели коллекции Modern &ndash; это дополнение к дизайнерскому решению интерьера, но не его доминанта.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Design</h4>\r\n<div style="text-align: justify;">В серии Design в полной мере воплощается умение дизайнеров фабрики одним-двумя штрихами превратить казалось бы обычное дверное полотно в яркий элемент современного интерьера. Так, например, в модели Over 18 L это достигается за счет тонкой линии стекла, а в Over 100 &ndash; фактурным геометрическим орнаментом.&nbsp;</div>\r\n<div style="text-align: justify;">Приковывающие внимание сами по себе, двери коллекции Design требуют смелости от проектировщика интерьера. У него не получится обойтись стандартными решениями и придется искать, как отразить идеи дверей Impronta в общем оформлении пространства. Впрочем, результат стоит этих трудов.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>Classic</h4>\r\n<div style="text-align: justify;">Особая коллекция, в которой фабрике удалось сохранить простоту и домашний уют классических итальянских интерьеров. Натуральное дерево, простые формы и отсутствие даже полунамека на современный дизайн &ndash; вот на чем базируются модели этой серии. Главные герои коллекции &ndash; Rustica B и Rustica M. Воплощение итальянской этноклассики и идеальное раскрытие красоты простого дерева, не спрятанного за тяжелой фурнитурой, строгими линиями и излишним декором.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h4>NextDoor</h4>\r\n<div style="text-align: justify;">Удивительно, насколько точно дизайнерам удалось отразить тенденции современного дизайна, балансирующего на грани минимализма. Работая над коллекцией, они четко выдержали баланс между предельной простотой и изысканностью. Однотонное сплошное полотно, дополненное лаконичной фурнитурой, в буквальном смысле выдвигается на первый план. Широкий косяк по двум сторонам создает актуальную асимметрию, а боковая подсветка берет на себя задачу тех самых штрихов, которые превращают функциональность в дизайн.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h3>Входные двери</h3>\r\n<div style="text-align: justify;">Входные двери Impronta представлены не так широко, но столь же стилистически разнообразно. Этническая Asolo хранит традиции маленьких итальянских городков и деревень. Трехпанельная Classica воплощает идею функциональной простоты и классического оформления. Стильные, аккуратные и лаконичные Philos выполнены в лучших традициях европейского минимализма.&nbsp;</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<h3>Другая продукция</h3>\r\n<div style="text-align: justify;">Не ограничиваясь только дверьми, Impronta создает окна и ставни, разрабатывает интерьеры для гостиниц и выполняет комплексные дизайн-проекты. И везде предлагает три стилевых направления &ndash; этноклассика, современная классика и уникальные дизайнерские решения.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей Impronta.</div>\r\n<p>&nbsp;</p>', 'http://www.impronta.info/', 8, 1, NULL, NULL, NULL),
	(14, 'Longhi', 'Longhi', 5617, '<p>Ассортимент итальянской фабрики Longhi не ограничивается дверьми. Компания предлагает коллекцию мебели для жилых и офисных помещений: диваны и кресла, столы, столики и стулья, шкафы и стеллажи, а также аксессуары: ковры, лампы, зеркала пледы и подушки. Но своей мировой популярность Longhi обязана все-таки межкомнатным перегородкам и дверям.</p>\r\n<div>Говоря о своей продукции, Longhi подчеркивает, что все изделия соответствуют требованиям к современному образу жизни. В своих работах дизайнеры и проектировщики отталкиваются от функциональности и практичности. Что, впрочем, не мешает им создавать двери и мебель, наполненные индивидуальностью. Продукция Longhi &ndash; это и не хай-тек, и не попытки воссоздать ретро-интерьеры. Это естественно развитие стиля. Сочетание классических идей с современными требованиями к конструкции и облику.</div>\r\n<div>&nbsp;</div>\r\n<div>Тот факт, что фабрика производит не только двери, говорит о глубоком понимании, как должны сочетаться элементы интерьера. Все предметы создаются не в отрыве от реальности, а в контексте современных дизайнерских решений. Даже если вы не планируете обставлять комнату мебелью исключительно этого производителя, то заметите, с какой легкостью двери Longhi вписываются в общую картину.</div>\r\n<div>&nbsp;</div>\r\n<div>Фабрика предлагает десять коллекций, в каждой их которых представлены раздвижные перегородки разных конструкций и традиционные распашные двери.</div>\r\n<div>&nbsp;</div>\r\n<h4>IANUS</h4>\r\n<div>Эту серию Longhi посвятила римскому богу дверей и проходов Янусу. Подобно этому божеству, двери коллекции IANUS сочетают два лица, две черты характера. Предельно простые и лаконичные формы поверхностей настраивают на минимализм, в то время как рисунок стекла и масштабность конструкций стеновых панелей находятся на грани роскоши и шика.</div>\r\n<div>&nbsp;</div>\r\n<h4>CRISTALL</h4>\r\n<div>Кристально чистые решения, тонкие линии наличников и простые формы фурнитуры &ndash; вот основные отличия этой серии, очень точно отмеченные названием коллекции.</div>\r\n<div>&nbsp;</div>\r\n<h4>HEADLINE</h4>\r\n<div>Название этой серии переводится как &laquo;заглавие&raquo;. HEADLINE &ndash; это противопоставление современной тенденции создания &laquo;незаметных&raquo; перегородок. Однако заметность сочетается со сдержанностью, поэтому двери не доминируют в интерьере, а как бы озаглавливают его.</div>\r\n<div>&nbsp;</div>\r\n<h4>WIND</h4>\r\n<div>Еще один образец легких решений. Но, в отличие от минималистичной коллекции CRISTALL, двери WIND обладают характером, хотя и не выставленным напоказ.</div>\r\n<div>&nbsp;</div>\r\n<h4>SPARK</h4>\r\n<div>Если пытаться перевести это название, то более точным будет слово &laquo;проблеск&raquo;. На этой коллекции хорошо видно, как Longhi последовательно развивает свои идеи. От минималистичных&nbsp;CRISRALL через наполненных характером WIND к проблеску индивидуальности. Без потери легкости и простоты форм.</div>\r\n<div>&nbsp;</div>\r\n<h4>STREET</h4>\r\n<div>Пусть вас не вводит в заблуждение название этой коллекции. Двери STREET &ndash; межкомнатные, а не уличные. В распахнутом виде они становятся практически незаметными, нивелируя ощущение разделенного дверным проемом пространства.</div>\r\n<div>&nbsp;</div>\r\n<h4>WOOD STRIPED</h4>\r\n<div>Называя эту серию, компания Longhi решила обойтись без метафор и просто объединила материал и форму. Отделка широкими деревянными полосами &ndash; беспроигрышный вариант для практически любых помещений. Впрочем, модели этой коллекции получились чересчур строгими для дома. Зато идеально подходящими для офисных помещений.</div>\r\n<div>&nbsp;</div>\r\n<h4>SHADOW</h4>\r\n<div>Восточные решетчатые мотивы в дизайне дверей давно стали негласным стандартом отрасли. Но и здесь Longhi удалось проявить индивидуальность, избавившись от этнического оттенка, но сохранив уют ритмичных горизонтальных полос.</div>\r\n<div>&nbsp;</div>\r\n<h4>WALL-UP</h4>\r\n<div>Настоящий шедевр и отличная демонстрация глубоких познаний не только в интерьерном дизайне, но и в архитектуре. Полотно представляет собой массивную ровную поверхность без каких бы то ни было декоративных элементов и фурнитуры. Высотой до потолка дверь выглядит словно часть стены, чуть выдвинутая вперед. Еще более интересный эффект достигается, когда межу верхней частью дверного проема и потолком остается пространство.</div>\r\n<div>&nbsp;</div>\r\n<h4>LORD SYSTEM</h4>\r\n<div>Longhi &nbsp;удается сочетать несочетаемые, на первый взгляд, вещи. В коллекции LORD монументальность и насыщенностью гармонично сосуществуют с простотой. Видимо, весь секрет в благородной отделке и удлиненной форме.</div>\r\n<div>Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей Longhi.</div>', 'http://www.longhi.it/', 11, 1, NULL, NULL, NULL),
	(15, 'Lualdi', 'Lualdi', 5637, '<p>Глядя на продукцию итальянской фабрики Lualdi, кажется, что это молодая команда чрезвычайно талантливых дизайнеров, находящихся в постоянном поиске. Однако за этой кажущейся молодостью стоит более чем вековой опыт производства мебели. Творческий путь фабрики начался в конце 19 века. Причем, производство дверей стало основным направлением лишь с середины 20 века.</p>\r\n<div>&nbsp;</div>\r\n<div>Основы подхода Lualdi Porte к дизайну заложил один из самых эксцентричных итальянских архитекторов Луиджи Доминеоне. Его идеи до сих пор используются в некоторых коллекциях, а дизайнеры Lualdi хранят верность нестандартному и смелому подходу, принесшему компании мировую известность.</div>\r\n<div>&nbsp;</div>\r\n<div>Смелость Lualdi не только в форме, но и в материале. Лакированный полиэстер, кожа, шпон алюминий гармонично сочетаются в динамичных работах моделях фабрики. Особое внимание уделяется технологическим решениям. Незаметные конструкции, скрытые рамы, лаконичная фурнитура, широкий выбор цветовой гаммы и возможность окрасить или оформить дверное полотно обоями открывают огромный простор для фантазии.</div>\r\n<div>&nbsp;</div>\r\n<div>Основная коллекция насчитывает 17 моделей, объединенных идеей технологичности и универсальности.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; OUTLINE &ndash; воплощение минимализма, подчеркнутого названием, которое переводится как &laquo;набросок&raquo;. Чистый объем и трехмерность создают произведение архитектуры, способное придать любому пространству определенность и завершенность.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; Сдвижные двери DRIVE выглядят как стеновые панели или элемент декора, скрывая свое основное функциональное назначение. Алюминиевые направляющие естественного &nbsp;или черного цвета крепятся над дверным проемом и скрываются полотном. Невидимый крепеж создает эффект необычайной легкости.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; Модель SHOIN создана дизайнерами, вдохновленными светом и мобильностью поверхностей традиционного японского дома. Система состоит из одного или двух стеклянных полотен в тончайшей алюминиевой раме и межкомнатных перегородок.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; Шарнирное крепление, большая толщина и невидимый алюминиевый косяк создают ощущение, что дверь RASOMURO 55N &ndash; это часть стены, а не отдельный элемент пространства.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; RASOMURO 41 отличаются тонкой алюминиевой коробкой, которая, в отличие от предыдущей модели, ненавязчиво обозначает дверной проем, но тоже не акцентирует на нем излишнего внимания.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; COMPASS 55 с самозакрывающимся механизмом, скрытой коробкой и нестандартным креплением полотна можно сравнить с плотным занавесом. Эти двери и разделяют пространство, и дают ощущение легкости, с которой можно перемещаться из помещения в помещение.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; WALL &amp; DOOR &ndash; система из дверей и стеновых панелей, созданная для простых рациональных решений. Идеально для офисных помещений.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; Двусторонние FILO 55 с широкими косяками и идеально чистой и ровной поверхностью отлично подходят для покраски и отделки. Простые формы позволяют использовать эти двери в любых современных интерьерах.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; Двери BLUES &ndash; еще один пример, как Lualdi удается минимальными средствами добиться &nbsp;выразительного эффекта. Отличительные особенности этой модели &ndash; алюминиевый косяк средней ширины и тонкое обрамление стеклянных полотен.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; Строгость дверей ALA создана тонкими горизонтальными линиями из нержавеющей стали. Тень, отбрасываемая наличниками особой формы, убирает контраст между дверным проемом и стеной, приумножая объем и трехмерность.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; Простые формы модели LCD62 сочетаются с реверсивными скрытыми петлями и косяком, адаптируемым к различной толщине стен. На этом простом примере Lualdi доказывает, что технологичность зачастую важнее формы и декора.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; Двери SAN SIRO &ndash; смелая интерпретация классических форм, заключающаяся в игре с пропорциями и чуть диссонирующим оформлением дверного полотна.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; ESSE и ESSE03 &ndash; еще одно нестандартное решение. Изогнутое полотно напоминает о мягкости натуральных форм и гармоничном движении волны.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; SUPER &ndash; современное видение исторической модели, созданной Луиджи Доминеоне. Ее особенности &ndash; тонкая рама с округлыми формами, чуть выступающее полотно со скругленными торцами и скрытые реверсивные петли.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; Двери TRIS и LCD87, как развитие идей, заложенных в предыдущей модели, отличаются еще более выраженными округлостями торцов и дверного полотна.</div>\r\n<div>American collection - особые коллекции Lualdi, созданные тремя американскими архитекторами. В результате сотрудничества на свет появилось три серии, каждая из которых сочетает индивидуальность авторов из США с лучшими традициями итальянской фабрики.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; В серии DAVINA дизайнер Дрор Беншетрит очень точно уловил идею технологичного минимализма. Простая диагональ создает ощущение двуцветной глубины, которая раскрывается внутри дверной коробки и создает иллюзию того, что дверь слегка приоткрыта.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; UPTOWN, MIDTOWN и &nbsp;DOWNTOWN &ndash; три модели, созданные Дэвидом Роквеллом из благородных материалов. Отделка древесиной ценных пород, два бронзовых горизонтальных штриха и ручка из натуральной кожи, проходящая по всей длине двери, великолепно отражают идею американского размаха и богатства, органично выставленного на всеобщее обозрение.</div>\r\n<div>&nbsp;</div>\r\n<div>&ndash; В моделях AVENUE Роберт Стерн продемонстрировал, что такое американский взгляд на итальянскую утонченность. Симметричные и сбалансированные, они дополняют современные интерьеры бессмертными классическими формами.</div>\r\n<div>&nbsp;</div>\r\n<div>Кроме межкомнатных дверей, Lualdi предлагает комплексные интерьерные решения для оформления офисов, выставочных залов и гостиничных номеров.</div>\r\n<div>&nbsp;</div>\r\n<div>Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей Lualdi.</div>', 'http://www.lualdiporte.com/', 17, 1, NULL, NULL, NULL),
	(16, 'New Design Porte', 'New-Design-Porte', 5761, '<p style="text-align: justify;">Компания &nbsp;New Design Porte квартирует в Монтериджони, в Тоскане. В 1996 году группа энтузиастов, имевших за плечами немалый опыт работы в столярном производстве, решила объединиться для создания собственного предприятия. Знания и навыки, накопленные за предшествующие годы, вместе с возможностью осуществления собственных идей и взглядов на производство межкомнатных дверей стали удачным для молодой компании сочетанием. New Design Porte быстро стала известна как производитель по-настоящему стильных дверей для потребителей, стремящихся оформить свой дом со вкусом.</p>\r\n<div style="text-align: justify;">Ориентируясь в разработке моделей дверей на стили самых разных эпох, New Design Porte удачно совмещают современные технологии обработки дерева с ручной работой мастера-декоратора. В отделке нередко используются материалы, применявшиеся сотни лет назад: патина, пчелиный воск гуммилак. Таким образом, возникает уникальная ситуация. Продукция фирмы не имитирует двери XVII или XVIII веков, не является подделкой под старину. Это &mdash; настоящие классические деревянные двери, произведенные в XXI веке из материалов и по технологиям, применявшихся в века прошлые. Отличить двери New Design Porte от старинных дверей под силу лишь специалисту, настолько точно они передают все тонкости работы древних мастеров!</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Классика &mdash; не единственная страсть дизайнеров New Design Porte. Талантливые разработчики черпают вдохновение не только в прошлом, а и в будущем, талантливые производители внедряют оборудование, созданное с применением новейших технологий.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Технологии, современное оборудование &mdash; и ручная отделка; инновационные материалы &mdash; и натуральные продукты, применявшиеся сотни лет назад; классика и современность. New Design Porte умеет работать и с новейшей обрабатывающей производственной линией, и с традиционными стамеской и резчиком. Уникальная компания, производящая уникальные двери.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Коллекции дверей New Design Porte представляют собой учебник по истории искусства, каждая из них представляет отдельную эпоху, отдельный стиль.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Коллекция <strong>LE EMOZIONI</strong>, Эмоции, представляет неоклассицизм. <strong>XIV</strong> <strong>век</strong> посвящена итальянскому готическому средневековью, а <strong>XV</strong> <strong>век</strong> &mdash; Ренессанс, эпоху, когда столярное производство регламентировалось множеством правил, эпоху, давшую миру столько прекрасных произведений искусства!</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Далее каталог компании ведёт нас от коллекции <strong>XVI</strong> <strong>век</strong>, Позднего Возрождения, к коллекции в стиле барокко <strong>XVII</strong> <strong>век</strong>. Развившийся далее новаторский стиль рококо представлен в коллекции межкомнатных дверей <strong>XVIII</strong> <strong>век</strong>, естественно перетекая в модернизм, art nouveau, с блеском отражённые коллекцией <strong>XX</strong> <strong>век</strong>.</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Для остекления дверей используются стекло с гравировкой, витражи, сатинированные стёкла со вставками из плавленого стекла. Вся фурнитура, петли, шарниры и дверные ключи разрабатываются в соответствии с выбранной стилистикой. Задвижки, щеколды, дверные колотушки и другие аксессуары выглядят, как музейные экспонаты. Каждая мелкая деталь, каждый гвоздь соответствуют эпохе коллекции. Нет никаких сомнений в том, что New Design Porte &mdash; уникальная компания, производящая уникальные межкомнатные двери!</div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей New Porte.</div>', 'http://www.newdesignporte.com/', 3, 1, NULL, NULL, NULL),
	(17, 'Oikos', 'Oikos', 5624, '<p>С 1990 года Oikos производит бронированные двери на своей фабрике в Груаро (Венеция). Oikos стремится контролировать не только каждый этап, а и каждый момент производства, и все работы ведутся в рамках фабрики, которая разделена на три основные части: механическая и столярные мастерские, и цех сборки. Столь кропотливую заботу о качестве в компании считают необходимым условием успеха.</p>\r\n<div>&nbsp;</div>\r\n<div>В секторе производства бронированных дверей Oikos занимает лидирующие позиции. С самого начала работы компания принимает регулярное участие в престижной международной выставке MADE, ранее называвшейся Saie. Каждую новую модель перед запуском в производство Oikos представляет на выставке, и такой способ проверки &laquo;живучести&raquo; продукции требует немалой уверенности в своих силах. Такая уверенность у компании, разумеется, есть. Как и умение организовать все этапы разработки и производства, и многие другие качества, необходимые лидеру отрасли.</div>\r\n<div>&nbsp;</div>\r\n<div>Только в Италии розничная сеть Oikos насчитывает 300 точек продажи. Знают бронированные двери, произведенные на фабрике в Груаро, и далеко за пределами страны.</div>\r\n<div>&nbsp;</div>\r\n<div>Свою миссию Oikos видит в обеспечении безопасности жилища. Для этой цели в компании созданы линии бронированных дверей, дизайн и разнообразие отделки которых разрабатывались таким образом, чтобы двери Oikos можно было установить в домах любой архитектуры, с любой конструкцией стен, и чтобы эти двери удовлетворяли любые эстетические запросы жителей этих домов.</div>\r\n<div>&nbsp;</div>\r\n<h4>SYNUA</h4>\r\n<div>Чистый и элегантный дизайн делает эти двери универсальными. Synua будет уместна и в многоквартирном доме типового проекта, и в частном особняке престижного архитектора.</div>\r\n<div>Эта дверь имеет довольно большие размеры, вращается на вертикальных осевых петлях и устанавливается в одной плоскости со стеной. &nbsp;Ширина двери может достигать 220 см, высота &mdash; 300. Минимально возможная ширина полотна составляет 115 см. Внешне элегантная и изысканная, такая дверь станет неприступной защитой дома благодаря использованию высокопрочной стали и запатентованной конструкции запоров. Среди вариантов отделки компания предлагает дерево, различные виды лакировки, отделку под керамику и под кожу, и другие.</div>\r\n<div>&nbsp;</div>\r\n<h4>VELA</h4>\r\n<div>Двери для внутреннего использования в помещениях, доступ в которые требует защиты. Vela &mdash; это первая модель раздвижной бронированной двери. Высота двери соответствует высоте помещения: открытая дверь значительно расширяет пространство, закрытая &mdash; делает помещение неприступным. Возможна также установка на вертикальных осевых шарнирах как вариант распашной двери.</div>\r\n<div>Для отделки дверей могут быть использованы все доступные Oikos материалы. Таким образом, обеспечивается возможность органичной интеграции Vela в любую стилистику интерьера.</div>\r\n<div>&nbsp;</div>\r\n<h4>iDOOR</h4>\r\n<div>Бронированные двери для внутренних помещений, совмещающие высокую функциональность с эстетикой. Создание iDoor стало ещё одним шагом Oikos к обеспечению безопасности жилища. Благодаря этим дверям любая комната может стать абсолютно безопасной, а широкий выбор цветов и материалов отделки позволит гармонично вписать дверь в любой интерьер.</div>\r\n<div>&nbsp;</div>\r\n<h4>TEKNO</h4>\r\n<div>Современные бронированные входные двери, для создания которых потребовался крепкий сплав высоких технологий и дизайнерских инноваций. Горизонтальные элементы двери могут иметь разнообразную отделку, в соответствии с пожеланиями заказчика.</div>\r\n<div>&nbsp;</div>\r\n<h4>EVOLUTION</h4>\r\n<div>Бронированные двери с классическим дизайном. Предлагается широкий выбор размеров, моделей и индивидуальных вариантов изготовления. Классическая отделка благородных пород дерева скрывает под собой мощную стальную конструкцию.</div>\r\n<div>Все двери Oikos обеспечивают высокий уровень тепло- и звукоизоляции, их отделка способна сопротивляться воздействию влаги и стойко переносит перепады температур.</div>\r\n<div><br />\r\nКомпания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей Oikos.</div>', 'http://www.oikos.it/', 25, 1, NULL, NULL, NULL),
	(18, 'Paolo Lucchetta', 'Paolo-Lucchetta', 5599, '', 'http://www.paololucchetta.net/', 13, 1, NULL, NULL, NULL),
	(19, 'Porte in Door', 'porte-in-door', 5630, '<p>Porteindoor &mdash; именно тот случай, когда слово &laquo;молодость&raquo; никак не означает &laquo;неопытность&raquo;. Основанная уже в нынешнем тысячелетии, молодая фабрика быстро заняла лидирующие позиции на рынке. В таких случаях принято говорить о &laquo;секретах успеха&raquo;, но здесь секрет не составляет никакой тайны и лежит на поверхности. Просто создатели межкомнатных дверей Porteindoor умеют смотреть и в прошлое, и в будущее. Из прошлого почерпнуты традиции и наработки итальянских ремесленников, а в будущем дизайнеры сумели усмотреть тенденции развития. Вот и весь секрет, который и дал нам эти прекрасные двери: сочетание традиций тосканских мастеров-краснодеревщиков и современных трендов!</p>\r\n<div>&nbsp;</div>\r\n<div>Фабрика была создана в 2004 году. Производство возникло не на пустом месте, ему предшествовали немалый опыт в проектировании и создании межкомнатных дверей и творческое сотрудничество с известным дизайнером Марко Менкаччи. Огромное внимание в компании уделяется конструктивным исследованиям и поискам новых решений в дизайне. Такая скрупулёзность и стала причиной того, что двери Porteindoor отлично сочетаются с совершенно разными интерьерами. Общественные помещения или частные дома, классический дизайн или футуристическая отделка, &mdash; эти двери везде выглядят на своём месте!</div>\r\n<div>&nbsp;</div>\r\n<div>Porteindoor радует потребителей ежегодными пополнениями коллекций. Новые краски, новые материалы, новые конструкции и новые идеи &nbsp;не перестают радовать поклонников продукции этой компании! Porteindoor предлагает обширную коллекцию стандартных моделей межкомнатных дверей, но при желании производит и двери на заказ. Срок производства заказных моделей несколько дольше обычного, так как такие двери изготавливаются вне налаженного технологического цикла.</div>\r\n<div>&nbsp;</div>\r\n<div>Сегодня фабрика предлагает 13 коллекций с большим количеством моделей в каждой. Все модели разработаны Марко Менкаччи. Расскажем о наиболее популярных из коллекций Porteindoor.</div>\r\n<div>&nbsp;</div>\r\n<h4>PRISMA</h4>\r\n<div>Необычный вид этим дверям придаёт створка, составленная из двух частей, разделённых вертикальным уголком. Части двери расположены под углом друг к другу, что выглядит нестандартно, свежо и современно. Среди 24-х вариантов отделки несложно будет выбрать тот, который подойдёт к вашему интерьеру!</div>\r\n<div>&nbsp;</div>\r\n<h4>CAVALIERI</h4>\r\n<div>На создание этой коллекции дизайнера вдохновили лучшие произведения итальянских архитекторов. Элегантные детали, закруглённые элементы, гениальная простота: чтобы создать такие двери, мастеру оказалось достаточно лишь посмотреть вокруг&hellip; и выразить свои ощущения!</div>\r\n<div>&nbsp;</div>\r\n<h4>MANTEGNA</h4>\r\n<div>Утончённый эстет, знаток и поклонник искусства эпохи Возрождения, выберет, без сомнения, эти модели! А более двух десятков видов отделки и качество исполнения XXI века делают дизайн &laquo;а-ля средневековье&raquo; как нельзя более актуальным и современным.</div>\r\n<div>&nbsp;</div>\r\n<h4>CANALE</h4>\r\n<div>Оригинальность этой коллекции придаёт светлый вертикальный &laquo;канал&raquo; по центру дверного полотна, в некоторых моделях сочетающийся с круглыми &laquo;окошками&raquo;.</div>\r\n<div>&nbsp;</div>\r\n<h4>NOVA</h4>\r\n<div>Широкий закруглённый наличник из цельной древесины в этих моделях служит не просто элементом конструкции дверей, а придаёт им исключительно гармоничный вид. Дух ART NOUVEAU, гармония и простота, нашёл своё современное воплощение в этой коллекции.</div>\r\n<div>&nbsp;</div>\r\n<h4>IMPERIALE</h4>\r\n<div>Лёгкие формы с геометрически внушительным контуром, декоративная &laquo;корона&raquo;, венчающая каждую дверь, средиземноморские мотивы в орнаменте отделки. Эта коллекция стала данью уважения мастера вечно живому стилю &laquo;ампир&raquo;.</div>\r\n<div>&nbsp;</div>\r\n<h4>TOSCA</h4>\r\n<div>Tosca &mdash; это не только опера гениального Пуччини, это ещё и коллекция не менее гениальных дверей от Porteindoor в тосканском стиле! Ручная отделка состаренным орехом, горизонтальные линии делают дверь похожей на вход в старинную таверну. Эти двери прекрасно подтверждают редкое умение мастеров фабрики сочетать древние традиции и современность.</div>\r\n<div>&nbsp;</div>\r\n<div>Компания &quot;Абсолют Интерьер&quot; рада предложить широкий выбор дверей Porte in Door.</div>', 'http://www.porteindoor.com/it/', 16, 1, NULL, NULL, NULL),
