	(23, 'Itlas', 'Itlas', 5642, '<p style="text-align: justify;">Компания Itlas &mdash; одно из самых крупных предприятий по производству паркета в Италии. Производимая данной фабрикой паркетная доска &mdash; это напольное покрытие высочайшего класса, на 100% состоящего из натурального дерева, качество и селекция которого соответствует самому высокому уровню требований. С паркетной доской ITLAS Вы сможете воплотить в жизнь самые смелые дизайнерские решения, т. к. в ассортименте фабрики представлены как европейские, так и экзотические породы деревьев с различными видами обработок: лак, масло, брашировка, волнистое строгание, битая фаска, искусственное старение, тиснение не дереве.</p>', 'http://www.itlas.com/', 29, 1, NULL, NULL, NULL),
	(24, 'Linea Cali', 'Linea-Cali', 5644, '<p>Фабрика Linea cali &nbsp;основана в 1986 году &nbsp;господином Валле Саббиа (Valle Sabbia) и является одной из ведущих итальянских компаний, производящих дверные и оконные ручки.</p>\r\n<div>&nbsp;</div>\r\n<div>Фабрика создает ручки, которые, благодаря инновационному креплению и защитным технологиям, таким как циркониевое защитное покрытие (PVD), выдержат все: износ, удары и время.</div>\r\n<div>&nbsp;</div>\r\n<div>Уровень &nbsp;мастерства и качество материалов позволяют выпускать продукцию от Роккоко до Арт декора, от кожи до дерева, от керамики до кристаллов Swarovski&reg;.</div>\r\n<div>&nbsp;</div>\r\n<div>Фабрика гарантирует, что каждая ручка разработана и сделана только в Италии в полном соответствии с требованиями законодательства и европейских стандартов.</div>', 'http://www.lineacali.it/', 26, 1, NULL, NULL, NULL),
